package day

import (
	"testing"
)

func Test_F20221110(t *testing.T) {
	t.Parallel()

	tests := []struct {
		str   string
		restr string
	}{
		{"", ""},
		{"1", "1"},
		{"12", "21"},
		{"123", "321"},
	}

	for _, test := range tests {
		test := test
		t.Run(test.str, func(t *testing.T) {
			t.Parallel()
			got := F20221110(test.str)
			if got != test.restr {
				t.Error(test.restr, got)
			}
		})
		t.Run(test.str, func(t *testing.T) {
			t.Parallel()
			got := F20221110_2(test.str)
			if got != test.restr {
				t.Error(test.restr, got)
			}
		})
	}
}

var str string = ""

func BenchmarkF20221110(b *testing.B) {
	for i := 0; i < b.N; i++ {
		F20221110(str)
	}
}

func BenchmarkF20221110_2(b *testing.B) {
	for i := 0; i < b.N; i++ {
		F20221110_2(str)
	}
}
